import React, { useEffect, useState } from "react";

const PostFeed = () => {
  const [postPage, setPostPage] = useState({ content: [] });

  useEffect(() => {
    const loadPosts = async () => {
      try {
        const response = await getPosts();
        setPostPage(response.data);
      } catch (error) {}
    };
    loadPosts();
  });

  return <div></div>;
};

export default PostFeed;
